import React from 'react';

interface Props {
  input: any
}

class Form extends React.Component<Props> {

  constructor(props: Props) {
    super(props);
    this.state = {
      input: ""
    };
  }

  render() {
    return (
      <form>
        <input type="text" value={this.state.input}/>
        <button>登録</button>
      </form>
    );
  }
}

export default Form;
